import React from 'react';

const Landing = () => (
  <div className="container">
    <h1>Landing Page</h1>
    <p>You are seeing this page because you are not logged in. Please sign in by clicking here</p>
    <p>or using the "Sign In" link above</p>
  </div>
);

export default Landing;
